export const setMostPopularGroups = (mostPopularGroups) => ({
  type: "SET_MOST_POPULAR_GROUPS",
  payload: mostPopularGroups,
});

export const setSearchedGroups = (groups) => ({
  type: "SET_SEARCHED_GROUPS",
  payload: groups,
});
